CREATE FUNCTION public.update_onhand_qty() RETURNS trigger
AS $$
BEGIN
    UPDATE books
    SET onhand_qty = onhand_qty + NEW.qty
    WHERE book_id = NEW.book_id;
    RETURN NEW;
END;
$$ LANGUAGE plpgsql;

CREATE TRIGGER update_onhand_qty_trigger
    BEFORE INSERT ON public.operations
    FOR EACH ROW
    EXECUTE FUNCTION public.update_onhand_qty();

