CREATE FUNCTION public.get_catalog(search text, orderby text, direction text)
RETURNS TABLE(
    book_id bigint, 
    title text, 
    authors_list authors[],
    format text,
    rating float,
    price numeric,
    votes_up integer,
    votes_down integer,
    onhand_qty integer,
    additional jsonb,
    pages integer
)
AS $$
BEGIN
    IF orderby IS NULL OR lower(orderby) NOT IN ('format','rating','price') THEN
        orderby := 'price';
    END IF;
    IF direction IS NULL OR lower(direction) NOT IN ('asc','desc') THEN
        direction := 'asc';
    END IF;
    RETURN QUERY EXECUTE format($query$
        SELECT b.book_id,
               b.title,
               array_agg(a ORDER BY ash.seq_num) authors_list,
               b.format::text format_text,
               b.rating,
               get_retail_price(b.book_id) price,
               b.votes_up,
               b.votes_down,
               b.onhand_qty,
               get_additional(b) additional,
               b.pages
        FROM books b
            JOIN authorships ash ON ash.book_id = b.book_id
            JOIN authors a ON a.author_id = ash.author_id
        WHERE %s
        GROUP BY b.book_id 
        ORDER BY %I %s
    $query$, search_cond(search), orderby, direction);
END;
$$ LANGUAGE plpgsql STABLE SECURITY DEFINER;

