CREATE FUNCTION webapi.cast_vote(auth_token uuid, book_id bigint, vote integer) returns void
AS $$
DECLARE
    user_id bigint;
BEGIN
    user_id := check_auth(auth_token);
    IF vote = 1 THEN
        UPDATE books b
        SET votes_up = votes_up + cast_vote.vote
        WHERE b.book_id = cast_vote.book_id;
    ELSIF vote = -1 THEN
        UPDATE books b
        SET votes_down = votes_down - cast_vote.vote
        WHERE b.book_id = cast_vote.book_id;
    ELSE
        -- ????? ?????? ???????????
    END IF;
END;
$$ LANGUAGE plpgsql VOLATILE SECURITY DEFINER;

