CREATE FUNCTION empapi.get_tasks()
    RETURNS TABLE (
        task_id bigint,
        program_id bigint,
        name text,
        host text,
        port text,
        started timestamptz,
        finished timestamptz,
        status text
    )
AS $$
    SELECT t.task_id,
           t.program_id,
           p.name,
           t.host,
           t.port,
           t.started,
           t.finished,
           t.status
    FROM tasks t
        JOIN programs p ON p.program_id = t.program_id
    ORDER BY task_id DESC;
$$ LANGUAGE sql STABLE SECURITY DEFINER;

