CREATE FUNCTION public.rating(up integer, down integer) RETURNS float AS $$
-- ?????? ??????? ?????????????? ????????? ???????? ??? ????????? ????????
-- https://habr.com/ru/company/darudar/blog/143188/
SELECT CASE WHEN up + down = 0
    THEN 0
    ELSE (
           (up + 1.9208) / (up + down) - 
           1.96 * sqrt((up * down) / (up + down) + 0.9604) / (up + down)
         ) / (1 + 3.8416 / (up + down))
    END::float;
$$ LANGUAGE sql IMMUTABLE;

