CREATE OR REPLACE FUNCTION public.sendmail(
    from_addr text,
    to_addr text,
    subj text,
    msg text
) RETURNS void
AS $$
    import smtplib
    server = smtplib.SMTP('localhost')
    server.sendmail(
        from_addr,
        to_addr,
        "\r\n".join([
            "From: %s" % from_addr,
            "To: %s" % to_addr,
            "Content-Type: text/plain; charset=\"UTF-8\"",
            "Subject: %s" % subj,
            "\r\n%s" % msg
        ]).encode('utf-8')
    )
    server.quit()
$$ LANGUAGE plpython3u VOLATILE;

